function is_cached(t) {
  var e = new Image();
  return (e.src = t), e.complete;
}
var index = "index" + "G1";
var current = "current" + "G1";
$.ajaxSetup({ cache: !1 }),
  $.get("feed.xml", function (t) {
    var e = $(t).find("item"),
      n = e.length;
    console.log(n),
      null == localStorage.getItem(index) && localStorage.setItem(index, n),
      null == localStorage.getItem(current)
        ? localStorage.setItem(current, 0)
        : 0 == localStorage.getItem(current)
        ? localStorage.setItem(current, 1)
        : localStorage.getItem(current) < n - 1
        ? localStorage.setItem(
            current,
            parseInt(localStorage.getItem(current)) + 1
          )
        : localStorage.setItem(current, 0),
      console.log(localStorage.getItem(current));
    var r = $(e[localStorage.getItem(current)]).find("description").text(),
      c = $(e[localStorage.getItem(current)]).find("title").text(),
      u = $(e[localStorage.getItem(current)]).find("linkfoto").text();
    $("#description").text(r),
      $("#title").text(c),
      $("#img").css("background-image", "url(" + u + ")");
});
